    "ls": ["occ", "swift"],
    "o": {
        "x": "<d><p>The Speech Synthesis Manager, formerly called the Speech Manager,\nis the part of the Mac OS that provides a standardized method for\nMac apps to generate synthesized speech. For example,\nyou may want your application to incorporate the capability to speak\nits dialog box messages to the user. A word-processing application might\nuse the Speech Synthesis Manager to implement a command that speaks\na selected section of a document to the user. Because sound samples\ncan take up large amounts of room on disk, using text in place of\nsampled sound is extremely efficient. For example, a multimedia application\nmight use the Speech Synthesis Manager to provide a narration of a\nQuickTime movie instead of including sampled-sound data on a movie\ntrack. <\/p><p>OS X v10.5 introduces native support for performing speech synthesis tasks using Core Foundation-based objects, such as speaking text represented as <c>CFString<\/c> objects and managing speech channel properties using a <c>CFDictionary<\/c>-based property dictionary. You should begin using these Core Foundation-based programming interfaces as soon as it’s convenient, because future synthesizers will accept Core Foundation strings and data structures directly through the speech synthesis framework. In the meantime, existing buffer-based clients and synthesizers will continue to work as before, with strings and other data structures getting automatically converted as necessary.<\/p><\/d>",
        "c": [{
            "o": {
                "x": "<d><p>You can check for version and feature availability\ninformation by using the Speech Synthesis Manager selectors defined\nin the Gestalt Manager. For more information see <i>Inside\nmacOS: Gestalt Manager Reference<\/i>. <\/p><\/d>"
            },
            "i": 1679841,
            "r": "subsection",
            "t": {
                "x": "Gestalt Constants"
            }
        }]
    },
