        "x": "<d><p>Apps that support a complication must define a class that supports this protocol and register it with the system. Your data source object provides the timeline entries displayed by your complication and provides information about the features that your complication supports.<\/p><p>You do not instantiate your data source class explicitly. After defining your class, specify the class name in the General tab of the project settings for your WatchKit extension. When the system needs data, it instantiates your class and initializes it by calling its <c>init<\/c> method. Once initialized, it calls the corresponding protocol methods to gather any needed data. (You can also specify your class name in your app’s <c>Info.plist<\/c> file using the <c>CLKComplicationsPrincipalClass<\/c> key.)<\/p><p>Your data source class is responsible for providing timeline entries and data for all of the complication families that you support. When the user installs your complication on the clock face, ClockKit creates an appropriate <tp s=\"lk\" t=\"1627991\"><\/tp> object. That complication object is often passed to your data source so that you know how to format your timeline entries. Use the General tab of your WatchKit extension’s project settings to specify the families you support.<\/p><p>Your complication data source class must implement the following methods of this protocol:<\/p><li s=\"bl\"><im><p><tp s=\"lk\" t=\"1628002\"><\/tp> <\/p><\/im><im><p><tp s=\"lk\" t=\"1628051\"><\/tp><\/p><\/im><im><p><tp s=\"lk\" t=\"1628026\"><\/tp> (watchOS 2 only)<\/p><\/im><im><p><tp s=\"lk\" t=\"1650686\"><\/tp> (watchOS 3 only)<\/p><\/im><\/li><p>You may implement other methods as needed to support the data in your complication. ClockKit calls the methods of your data source on the main thread of your WatchKit extension.<\/p><\/d>",
