                "x": "<d><p>When creating a <c>CLKRelativeDateTextProvider<\/c> object, you must specify which calendar units you want included in the resulting date. Only the following calendar units are supported: <\/p><li s=\"bl\"><im><p><tp s=\"lk\" t=\"1415822\"><\/tp><\/p><\/im><im><p><tp s=\"lk\" t=\"1408613\"><\/tp><\/p><\/im><im><p><tp s=\"lk\" t=\"1411920\"><\/tp><\/p><\/im><im><p><tp s=\"lk\" t=\"1409435\"><\/tp><\/p><\/im><im><p><tp s=\"lk\" t=\"1411272\"><\/tp><\/p><\/im><im><p><tp s=\"lk\" t=\"1413292\"><\/tp><\/p><\/im><im><p><tp s=\"lk\" t=\"1416859\"><\/tp><\/p><\/im><\/li><as s=\"nt\" n=\"Note\"><p>When creating a relative date provider using the <tp s=\"lk\" t=\"1627931\"><\/tp> style, only the <tp s=\"lk\" t=\"1411272\"><\/tp>, <tp s=\"lk\" t=\"1413292\"><\/tp>, and <tp s=\"lk\" t=\"1416859\"><\/tp> units are supported. <\/p><\/as><p>All other calendar units are ignored. <\/p><p>The format of the relative time value is dependent on the date style you choose when creating the text provider. For a list of possible styles and examples of each, see <tp s=\"lk\" t=\"1627902\"><\/tp>.  <\/p><\/d>"
