        "x": "<d><p>Each entry object represents a single data point along your complication’s timeline. You create and return timeline entries when asked to do so by ClockKit. When the date associated with a particular timeline entry occurs, ClockKit updates your complication’s interface with the data in the accompanying template object.<\/p><p>You can assign a group identifier to timeline entries to control the behavior of transition animations during Time Travel. When two timeline entries have different values in their <tp s=\"lk\" t=\"1628066\"><\/tp> property, or when the values are <c>nil<\/c>, ClockKit animates the transition between those entries during Time Travel. When two entries have the same group value, no animation is created. <\/p><\/d>"
