    "o": {
        "x": "<d><p>This provider creates strings like “10:15–11:15AM” where the time range may span hours, days, or some larger time interval. The text provider takes into account the user’s region and locale settings.<\/p><p>Time interval strings are more appropriate in complication families where there is sufficient space to draw the full time range, such as the modular large and utilitarian large families. In families where space is more limited, the provider may display only the start date of the time range. <\/p><p>When formatting the time interval, the time text provider drops the morning\/evening indicator of the start time when it is the same as the end time. Time intervals that are more than 24 hours are displayed as a range of days. The following are some examples of formatted time intervals: <\/p><li s=\"bl\"><im><p><c>9:30AM - 3:30PM<\/c><\/p><\/im><im><p><c>9:30 - 10:30AM<\/c><\/p><\/im><im><p><c>Jan 1 - Jan 7<\/c><\/p><\/im><im><p><c>1\/1 - 1\/7<\/c><\/p><\/im><\/li><\/d>"
    },
