        "x": "<d><p>Typical voice frequencies range from around 90 hertz for a low-pitched male voice to perhaps 300 hertz for a high-pitched child’s voice. These frequencies correspond to approximate pitch values in the ranges of 30.000 to 40.000 and 55.000 to 65.000, respectively.<\/p><p>This property is used with <tp s=\"lk\" t=\"1448425\"><\/tp> and <tp s=\"lk\" t=\"1448436\"><\/tp>.<\/p><as s=\"nt\" n=\"Note\"><p>The change in speech pitch may not be noticeable until the next sentence or paragraph is spoken.<\/p><\/as><\/d>"
