        "x": "<d><p>Each action plug-in can implement only one action. Actions can only apply to items with labels. An action can display a simple window inside the Address Book application; if your action actions needs to do anything else, it should launch your own application to perform the action.<\/p><p>Use Xcode to create Address Book action plug-ins. Place action plug-ins in <c>~\/Library\/Address Book Plug-Ins<\/c> or <c>\/Library\/Address Book Plug-Ins<\/c>, depending on the scope you want for the action.<\/p><\/d>"
